import React from 'react';
import PropTypes from 'prop-types';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import { createTheme } from '@mui/material/styles';
import HomeIcon from '@mui/icons-material/Home';
import PostAddIcon from '@mui/icons-material/PostAdd';
import ListAltIcon from '@mui/icons-material/ListAlt';
import StoreIcon from '@mui/icons-material/Store';
import GroupIcon from '@mui/icons-material/Group';
import SubscriptionsIcon from '@mui/icons-material/Subscriptions';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import NotificationsIcon from '@mui/icons-material/Notifications';
import LogoutIcon from '@mui/icons-material/Logout';
import { AppProvider } from '@toolpad/core/AppProvider';
import { DashboardLayout } from '@toolpad/core/DashboardLayout';
import { useDemoRouter } from '@toolpad/core/internal';
import Logout from './Logout'; // Import the Logout component

// Create a custom theme for the dashboard
const demoTheme = createTheme({
  cssVariables: {
    colorSchemeSelector: 'data-toolpad-color-scheme',
  },
  colorSchemes: { light: true, dark: true },
  breakpoints: {
    values: {
      xs: 0,
      sm: 600,
      md: 600,
      lg: 1200,
      xl: 1536,
    },
  },
});

// Define content for each section
const sections = {
  '/requirements': <Typography variant="h4">Requirements</Typography>,
  '/post': <Typography variant="h4">Post</Typography>,
  '/myposts': <Typography variant="h4">My Posts</Typography>,
  '/connect-to-shops': <Typography variant="h4">Connect to Shops</Typography>,
  '/my-connections': <Typography variant="h4">My Connections</Typography>,
  '/subscription': <Typography variant="h4">Subscription</Typography>,
  '/update-profile': <Typography variant="h4">Update Profile</Typography>,
  '/notifications': <Typography variant="h4">Notifications</Typography>,
  '/logout': <Logout />, // Use the custom Logout component here
};

// Content renderer based on the current route
function DemoPageContent({ pathname }) {
  return (
    <Box
      sx={{
        py: 4,
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        textAlign: 'center',
      }}
    >
      {sections[pathname] || (
        <>
          <Typography variant="h4">404</Typography>
          <Typography>Page not found.</Typography>
        </>
      )}
    </Box>
  );
}

DemoPageContent.propTypes = {
  pathname: PropTypes.string.isRequired,
};

// Navigation and routing
function DashboardLayoutNavigationLinks(props) {
  const { window } = props;
  const router = useDemoRouter('/update-profile'); // Initially set to Update Profile

  const demoWindow = window !== undefined ? window() : undefined;

  return (
    <AppProvider
      navigation={[
        { segment: 'requirements', title: 'Requirements', icon: <ListAltIcon /> },
        { segment: 'post', title: 'Post', icon: <PostAddIcon /> },
        { segment: 'myposts', title: 'My Posts', icon: <ListAltIcon /> },
        { segment: 'connect-to-shops', title: 'Connect to Shops', icon: <StoreIcon /> },
        { segment: 'my-connections', title: 'My Connections', icon: <GroupIcon /> },
        { segment: 'subscription', title: 'Subscription', icon: <SubscriptionsIcon /> },
        { segment: 'update-profile', title: 'Update Profile', icon: <AccountCircleIcon /> },
        { segment: 'notifications', title: 'Notifications', icon: <NotificationsIcon /> },
        { segment: 'logout', title: 'Logout', icon: <LogoutIcon /> },
      ]}
      router={router}
      theme={demoTheme}
      window={demoWindow}
    >
      <DashboardLayout>
        <DemoPageContent pathname={router.pathname} />
      </DashboardLayout>
    </AppProvider>
  );
}

DashboardLayoutNavigationLinks.propTypes = {
  /**
   * Injected by the documentation to work in an iframe.
   * Remove this when copying and pasting into your project.
   */
  window: PropTypes.func,
};

export default DashboardLayoutNavigationLinks;
